<!doctype html>
<html lang="en">
<head>
<meta charset="utf-8" />
<title>Trotl boben - kontrolor</title>
<link rel="stylesheet" href="http://code.jquery.com/ui/1.10.3/themes/smoothness/jquery-ui.css" />
<script src="http://code.jquery.com/jquery-1.9.1.js"></script>
<script src="http://code.jquery.com/ui/1.10.3/jquery-ui.js"></script>
<script>
$(function() {
	$( "#slider-range-min" ).slider({
	range: "min",
	value: 0,
	min: 0,
	max: 100,
	slide: function( event, ui ) {
	$( "#amount" ).val( ui.value );
	}
	});
	$( "#amount" ).val( $( "#slider-range-min" ).slider( "value" ) );
});

function j(){
	var i='';
	var k='';
	k=$('#smernica').val();
	if(k=='minus') {
        i=$('#amount').val()*-1;
		return i;
}
	else {i=$('#amount').val();}
	return i;
}

$(document).ready(function() {
	$('div').keypress(function() {	
		$("#slider-range-min a").focus();
		$.ajax({
			data: { amount : j() },
			type: 'POST', // GET or POST
			url: './tb_speed_write.php', // the file to call
			//success: function(response) {$('#liresults').html(response);},
		});	return false;
	})
	$('#slider-range-min a').mousemove(function() {	
		$("#slider-range-min a").focus();
		$.ajax({
			data: { amount : j() },
			type: 'POST', // GET or POST
			url: './tb_speed_write.php', // the file to call
			//success: function(response) {$('#liresults').html(response);},
		});	return false;
	})
	$('a').click(function() {	
		$("#slider-range-min a").focus();
		$.ajax({
			data: { amount : j() },
			type: 'POST', // GET or POST
			url: './tb_speed_write.php', // the file to call
			//success: function(response) {$('#liresults').html(response);},
		});	return false;
	})
	
	$('#pause').click(function() {	
		$("#slider-range-min a").hide();
		$("#pause").hide();
		$("#play").show();
		$.ajax({
			data: { amount : "0" },
			type: 'POST', // GET or POST
			url: './tb_speed_write.php', // the file to call
			//success: function(response) {$('#liresults').html(response);},
		});	return false;
	})
	$('#play').click(function() {	
		$("#slider-range-min a").show();
		$("#slider-range-min a").focus();
		$("#play").hide();
		$("#pause").show();
		$.ajax({
			data: { amount : j() },
			type: 'POST', // GET or POST
			url: './tb_speed_write.php', // the file to call
			//success: function(response) {$('#liresults').html(response);},
		});	return false;
	})
	$('#smer').click(function() {
		j();
		if( $('#smernica').val()=='plus' ) { 
			$('#smernica').val('minus');
			$("#smer span").html("smer &darr;");
		}
		else { 
			$('#smernica').val('plus'); 
			$("#smer span").html("smer &uarr;");
		}
		$("#slider-range-min a").show();
		$("#slider-range-min a").focus();
		$("#play").hide();
		$("#pause").show();
		$.ajax({
				data: { amount : j() },
				type: 'POST', // GET or POST
				url: './tb_speed_write.php', // the file to call
				//success: function(response) {$('#liresults').html(response);},
			});	return false;	
	})

})
</script>
<style>
#slider-range-min a {
	height:100px;
	width:100px;
	background-color:red;
}
#amount {
	border: 0; 
	color: red; 
	font-weight: bold;
	font-size:100px;
}
</style>
</head>
<body style="text-align:center;">
<div>
<form id="obrazec" method="POST">
	<input type="number" name="amount" id="amount" />
</form>
<br />
</div>
<div style="width:950px;height:95px;text-align:center" id="slider-range-min"></div>
<br /><br /><button id="pause">pavza</button>
<button id="play" style="display:none;">poženi</button>
<button name="smer" id="smer"><span>smer &uarr;</span></button>
    <input name="smernica" id="smernica" type="hidden" value="plus" />
<script>
$(function() {
  $("#slider-range-min a").focus();
});
$('html').click(function() {	
  $("#slider-range-min a").focus();
})

